import React from 'react'
import AChart from "react-apexcharts";
const op = (options, id, name) =>{

    options.chart.id = id;
    options.title.text = name;
    return(
            options
        )
};

const Seeds= ({todos, options}) =>{
    const todoList = todos.length ? (
        todos.map( (todo, index) => {
            let option = 'chart-'.concat(index);
            let name= todo.name;
            let parameters = op(options, option, name);
            console.log(parameters);
            console.log(options);
            return(
                <div className="col s6" key={index}>
                    <div className="card">
                        <AChart
                        options={parameters}
                        series={[todo]}/>
                    </div>
                </div>
            );
        }
        )
    ) : (
        <p className="center">Loading</p>
    );
    return(
        <div className="container">
            <div className="row">
                {todoList}
            </div>
        </div>
    );
}
export default Seeds;
